Mongo FindOne return results in error parameter<p>I am doing a login system in NodeJS with a Mongo database, so I try to look in my collection if the user exist. For my tests, I have a user registered, and I'm trying to find him.</p>
<p>My problem is that findOne method return the full user' data as I wish, but in the error parameter, not in the results parameter, and I have no logs to understand why...</p>
<p>Did somebody know why ?</p>
<p>Here is my code:</p>
<pre><code>app.post('/login', (req, res) =&gt;{
    console.log(req.body.identifier);
    console.log(req.body.password);

    client.connect().then(() =&gt; {

        let newUser = {identifier : req.body.identifier}
        res.redirect(req.body.locator)

        return client.db(`${process.env.MONGODB}`).collection(`${process.env.MONGOCOLLECTION}`).findOne(newUser).then((err, res) =&gt; {
            if (err){
                console.log(&quot;ERROR: &quot;+err.role)
                throw err;

            }else if(res){
                console.log(&quot;user found&quot;);
                console.log(res.role)
            }
      })
    }).catch( e =&gt; { console.error(e) }).then(() =&gt; {
        console.log(&quot;--------------------------------&quot;);
    })
})
</code></pre>
<p>And this is what I got :</p>
<pre><code>mail@mail.com
azer
