Getting a specific item from a list in BsonDocument<p>I am trying to get an item from a list with <code>Where()</code> in a BsonDocument to form a query. Participants is a <code>List&lt;User&gt;</code> where I would like to get a specific participant from. <code>Components</code> is a <code>List&lt;BsonDocument&gt;</code>, this makes indexing with <code>[&quot;key&quot;]</code> possible, because the properties on the object aren't known yet.</p>

<pre class="lang-js prettyprint-override"><code>var rec = (await _context.Records
                        .Where(r =&gt;
                        r.Components.Any(c =&gt;
                        c[&quot;StartTime&quot;] == record.StartTime &amp;&amp;
                        c[&quot;Participants.Number&quot;] == record.Organizer.Number))
                        .GetAsync())
                        .LastOrDefault();
</code></pre>

<p><code>[&quot;Participants.Number&quot;]</code> works on the list, but I would like to only check on a specific (second) participant in the list, I tried the following:</p>
<p><code>p[&quot;Participants[1].Number&quot;]</code></p>
<p><code>p[&quot;Participants&quot;][1][&quot;Number&quot;]</code></p>
<p>I also tried first converting to <code>BsonArray</code> and other <code>LINQ</code> functionality but didn't succeed in finding a solution.</p>

