How to store a reference to a MongoDB connection in a variable?<p>I have a bit of an issue with the asynchronous implementation of the MongoDB driver for Node.js.</p>
<p>In the documentation examples, connection takes place as follows:</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>const client = new MongoClient(uri, ...);

async function run() {

  try {
    await client.connect();
    const coll = client.db('locations').collection('streets');

    coll.find({...});

  } catch {

    ...

  } finally {

    client.close();

  }

}

run().catch(console.dir);

    </code></pre>
</div>
</div>
</p>
<p>But let's say I want to use the connection in an object rather than create a function for every case when I need the connection. For example, I want to create an object which would allow me to insert comments into a database:</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>const Comments = {
  connection: /* how would I put a MongoDB connection here when it's async? */,
  commentsCollectionRef: /* how would I put a collection reference here? */
  add: function(user, comment) {
          collectionRef.insertOne({user, comment});
  }
};

/* And to use the object like this to insert comments: */
Comment.add("Martin", "hello");
Comment.add("Julie", "hi");
Comment.add("Mary", "hello");

   </code></pre>
</div>
</div>
</p>
<p>Presumably, it is impossible to do something like this:</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>async function connect() {

  await client.connect();

}

const Comments = {

  connection: connect() /* this returns a promise, but you can't store a reference to its value like this */

  ...
